  type Data = {
    segmentedControl: string;
  };
  const defaultValues: Data = {
    segmentedControl: "ベジータ"
  };
  const {
    control,
    handleSubmit,
    watch,
    formState: {
      errors
    }
  } = useForm<Data>({
    defaultValues
  });
  const onSubmit: SubmitHandler<Data> = data => console.log("submit:", data);
  console.log("watch:", watch());
  return <VStack as="form" onSubmit={handleSubmit(onSubmit)}>
      <FormControl isInvalid={!!errors.segmentedControl} label="Who is your favorite character?" errorMessage={errors.segmentedControl?.message}>
        <Controller name="segmentedControl" control={control} rules={{
        required: {
          value: true,
          message: "This is required."
        }
      }} render={({
        field
      }) => <SegmentedControl {...field}>
              <SegmentedControlButton value="孫悟空">
                孫悟空
              </SegmentedControlButton>
              <SegmentedControlButton value="ベジータ">
                ベジータ
              </SegmentedControlButton>
              <SegmentedControlButton value="フリーザ">
                フリーザ
              </SegmentedControlButton>
            </SegmentedControl>} />
      </FormControl>

      <Button type="submit" alignSelf="flex-end">
        Submit
      </Button>
    </VStack>;
